import React from 'react';

export default function Layout({ header, main, sidebarRight, footer }) {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
      <header style={{ padding: '1rem', background: '#024731', color: '#ccc' }}>{header}</header>
      <div style={{ display: 'flex', flex: 1 }}>
        <main style={{ flex: 2, padding: '1rem' }}>{main}</main>
        <aside
          style={{
            width: '300px',
            padding: '1rem',
            background: '#012f1c',
            borderLeft: '1px solid #666',
          }}
        >
          {sidebarRight}
        </aside>
      </div>
      <footer style={{ padding: '1rem', background: '#024731', color: '#ccc' }}>{footer}</footer>
    </div>
  );
}
